import React from "react";
import {notes} from "../notes"
function firstNote(prop){
return <div>
    <h1>{prop.title}</h1>
    <p>{prop.content}</p>
    </div>;
}

function Note(){
    return <div className="note">
        <firstNote title={notes[1].title} content={notes[0].content}/>
    </div>;
}

export default Note;
